html,
body {
  display: float;
  align-items: center;
  justify-content: center;


  width: 100%;
  height: 100%;
  margin: 20;
  padding: 0;

  background-color: ##f2efed;
}






       /* Within Container */
    .zoom-within-container1 {
      transform: translateY(-600);
      height: 45em; /* [1.1] Set it as per your need */
      width: 12em;

      overflow: hidden; /* [1.2] Hide the overflowing of child elements */
    }
    .zoom-within-container1 img {
      transition: transform .25s ease;
    }
    .zoom-within-container1:hover img {
      transform: scale(1.2);
      width: 900;
    }

